// import Header from './components/Header/Header.jsx';
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Navbar from './components/Navbar/Navbar';

function App() {

  const [data, setData] = useState({ items: [] });

  useEffect(() => {
    fetch('./onedaydatadata.json')
      .then((response) => response.json())
      .then((data) => {
        setData(data);
        console.log(data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);


  return (
    <div>
      <Navbar />
      <main>
      <ul>
        {data.items.map((item) => (
          <li key={item.tagesplan}>
            <strong>{item.tagesplan[0].tag}:</strong> {item.description}
          </li>
        ))}
      </ul>
      </main>
    </div>
  );
}

export default App;
